@Override
    public int hashCode() {
        int valueHash = 0;
        V[] value = getValue();
        if (value != null) {
            for (int i = 0; i < value.length; i++) {
                valueHash += value[i].hashCode();
            }
        }

        return (this.getKey() == null ? 0 : this.getKey().hashCode())
                ^ valueHash;
